import SFProDisplayBoldurl from "./SFProDisplay-Bold.ttf";
import SFProDisplayMedurl from "./SFProDisplay-Medium.ttf";
import SFProDisplayRegurl from "./SFProDisplay-Regular.ttf";
import SFProDisplaySemiurl from "./SFProDisplay-Semibold.ttf";

export const SFProDisplayBoldConst = `@font-face {
  src: url(${SFProDisplayBoldurl});
  font-family: SFProDisplayBold;
}`;
export const SFProDisplayMedConst = `@font-face {
  src: url(${SFProDisplayMedurl});
  font-family: SFProDisplayMed;
}`;
export const SFProDisplayRegConst = `@font-face {
  src: url(${SFProDisplayRegurl});
  font-family: SFProDisplayReg;
}`;

export const SFProDisplaySemiConst = `@font-face {
  src: url(${SFProDisplaySemiurl});
  font-family: SFProDisplaySemi;
}`;
